import Head from 'next/head'
import useStore from '../'

export default function Bag() {
    const bag = useStore(state => state.bag)
    return (
        <div className="container">
            <Head>
                <title>Bag</title>
                <link rel="icon" href="/favicon.ico" />
            </Head>

            <main>
                <span>{bag}</span>
            </main>
        </div>
    )
}
